import React from 'react';
import './assets/css/Workspace.scss'
let Test = import(this.props.path)

class Workspace extends React.Component {

    generateComponent = () => {
        return (
            <div>{Test}</div>
        )
    }

    render() {
        return (
            <div className={"workspace"}>
                {this.generateComponent()}
            </div>
        )
    };
}

export default Workspace;
